import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal by clicking on the cart div (using text selector)
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');
    await page.waitForTimeout(500); // Allow modal to appear

    // Screenshot after opening cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Wait for cart modal and cart items to appear (using cart-item class)
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Find the first cart item's quantity span and the "+" button next to it
    // Use XPath to find the first cart-item and its "+" button
    const plusButton = await page.waitForSelector('(//div[contains(@class,"cart-item")]//button[contains(@class,"quantity-btn") and text()="+"])[1]', { timeout: 5000 });
    // Click the "+" button to increase quantity
    await plusButton.click();
    await page.waitForTimeout(500);

    // Screenshot after increasing quantity
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_increased.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_increased.png'));

    // Extract the updated quantity value from the first cart item
    const quantityValue = await page.$eval(
      '(//div[contains(@class,"cart-item")]//span[contains(@class,"quantity")])[1]',
      el => el.textContent
    ).catch(async () => {
      // Fallback: try using a different selector if above fails
      const el = await page.$('.cart-item .quantity');
      return el ? await el.textContent() : null;
    });

    // Extract the cart total value
    let cartTotal = null;
    try {
      cartTotal = await page.$eval('#cartTotal', el => el.textContent);
    } catch {
      // fallback: try another selector
      const el = await page.$('div.cart-total');
      cartTotal = el ? await el.textContent() : null;
    }

    return {
      success: true,
      action: "Opened cart modal and increased the quantity of the first cart item by 1",
      extractedData: {
        updatedQuantity: quantityValue ? quantityValue.trim() : null,
        cartTotal: cartTotal ? cartTotal.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
